class PortfolioPage extends Component {
    componentDidMount() {
        window.scroll(0, 0)

    }

    render() {
        return (
            <Fragment>
                <TopNavigation title="About"/>
                <PageTop pagetitle="Login System"/>
                <Login/>


            </Fragment>
        );
    }
}

export default PortfolioPage;
